Languages used in classical planning: PDDL Domain ğŸ’¡ "Plan once, run everywhere". A domain is a greater problem, defining the 'world'. In this world, you define entities ("types") like places, vehicles, general objects. You also define yes/no statements ("predicates") in combination with the instances of the types. Lastly, you define the things that you can do ("actions") that can be taken in this world. Requirements (:requirements :strips :typing) Types (:types city place physobj - object package vehicle - physobj truck airplane - vehicle airport location - place
) Predicates (:predicates (in-city ?loc - place ?city - city) (at ?obj - physobj ?loc - place) (in ?pkg - package ?veh - vehicle)) Actions (:action load-airplane :parameters (?pkg - package ?airplane - airplane ?loc - place) :precondition (and (at ?pkg ?loc) (at ?airplane ?loc)) :effect (and (not (at ?pkg ?loc)) (in ?pkg ?airplane))
) (:action unload-truck :parameters (?pkg - package ?truck - truck ?loc - place) :precondition (and (at ?truck ?loc) (in ?pkg ?truck)) :effect (and (not (in ?pkg ?truck)) (at ?pkg ?loc))
) Problem ğŸ’¡ A problem is a real problem to solve. A real problem is defined by its goal ("goal") and how things are looking currently ("initial state"). You also specify instances of the types ("objects") like "London" if the type is location . Goal (:goal (and (at p1 north) (at p2 south))
) Initial state Ground predicates that are positive only (:init (in-city cdg paris) (in-city lhr london) (in-city north paris) (in-city south paris) (at plane lhr) (at truck cdg) (at p1 lhr) (at p2 lhr) ) Objects (:objects plane - airplane truck - truck cdg lhr - airport south north - location paris london - city p1 p2 - package) STRIPS Actions in a state Action(Load(c,p,a) Precond: At(c,a) âˆ§ At(p,a) Effect: Â¬At(c,a) âˆ§ ... ) Initial state Init(At(...) âˆ§ Heigh(...)) Goal Goal(At(...) âˆ§ Heigh(...)) SATS Propositionalise the actions Initial state Instead of At(P1â€‹,SFO),At(P2â€‹,JFK) assert every fluent. Assert:At(P1â€‹,SFO)0,At(P2â€‹,JFK)0,Â¬At(P1â€‹,JFK)0,Â¬At(P2â€‹,SFO)0 Propositionalise the goal Add successor-state axioms Add precondition axioms Add action exclusion axioms ğŸ’¡ Why is dropping negative effects (in preconditions) better? It becomes easier to achieve all goal literals because preconditions are easier to meet. It becomes a relaxes problem because a plan in the original problem is also a valid plan in the transformed problem. ADD list and DEL list https://s3-us-west-2.amazonaws.com/secure.notion-static.com/79f8d982-d1f8-4a74-b268-da2c7b9dcc93/Untitled.png Heuristics Ignore delete lists Ignore preconditions Decompose problem into subproblems How to reformulate problem Create the new type if needed. Eg. time. Add predicate to indicate where we are in wrt to the new type. Eg. at_time(t1). Add predicate to move between the objects (that will always be true). Eg. time_next(t1 t2). Update actions to include these. Create the objects if they donâ€™t already exist. Eg. t1 t2 t3 - time. Update the initial state to include rules to guide the planner how to navigate in the search space. Eg. time_next(t1 t2) time_next(t2 t3)
